    false,nt"url": null,nt"notes": "Caribou were extirpated from the Kenai
    Peninsula by 1912 and reintroduced via transplants from the Nelchina Herd in the
    mid 1960s and again in the mid 1980s.  The reintroductions resulted in the establishment
    of five herds: the  Kenai Mountain Herd, Kenai Lowlands Herd, Killey River Herd,
    Fox River Herd and the Twin Lake Herd. Populations are increasing or stable for
